import React from 'react'
import './MyPokemon.css'

const MyPokemon = (props) => {
    return (
        <div className="my-pokemon-container">
            <h2>My Pokemon</h2>
            {props.favouritePokemon.map(pokemon => <li>{pokemon.name}</li>)}
        </div>
    )
}

export default MyPokemon
